y server you are using, has been blocked. The original block reason was: $1\";'),('en','messages:cant-see-hidden-user','s:152:\"The user you are trying to block has already been blocked and hidden.\nSince you do not have the hideuser right, you cannot see or edit the user\'s block.\";'),('en','messages:ipbblocked','s:73:\"You cannot block or unblock other users because you are yourself blocked.\";'),('en','messages:ipbnounblockself','s:40:\"You are not allowed to unblock yourself.\";'),('en','messages:ipb-default-expiry','s:0:\"\";'),('en','messages:lockdb','s:13:\"Lock database\";'),('en','messages:unlockdb','s:15:\"Unlock database\";'),('en','messages:lockdbtext','s:294:\"Locking the database will suspend the ability of all users to edit pages, change their preferences, edit their watchlists, and other things requiring changes in the database.\nPlease confirm that this is what you intend to do, and that you will unlock the database when your maintenance is done.\";'),('en','messages:unlockdbtext','s:227:\"Unlocking the database will restore the ability of all users to edit pages, change their preferences, edit their watchlists, and other things requiring changes in the database.\nPlease confirm that this is what you intend to do.\";'),('en','messages:lockconfirm','s:40:\"Yes, I really want to lock the database.\";'),('en','messages:unlockconfirm','s:42:\"Yes, I really want to unlock the database.\";'),('en','messages:lockbtn','s:13:\"Lock database\";'),('en','messages:unlockbtn','s:15:\"Unlock database\";'),('en','messages:locknoconfirm','s:39:\"You did not check the confirmation box.\";'),('en','messages:lockdbsuccesssub','s:23:\"Database lock succeeded\";'),('en','messages:unlockdbsuccesssub','s:21:\"Database lock removed\";'),('en','messages:lockdbsuccesstext','s:120:\"The database has been locked.<br />\nRemember to [[Special:UnlockDB|remove the lock]] after your maintenance is complete.\";'),('en','messages:unlockdbsuccesstext','s:31:\"The database has been unlocked.\";'),('en','messages:lockfilenotwritable','s:116:\"The database lock file is not writable.\nTo lock or unlock the database, this needs to be writable by the web server.\";'),('en','messages:databasenotlocked','s:27:\"The database is not locked.\";'),('en','messages:lockedbyandtime','s:33:\"(by {{GENDER:$1|$1}} on $2 at $3)\";'),('en','messages:move-page','s:7:\"Move $1\";'),('en','messages:movepage-summary','s:0:\"\";'),('en','messages:move-page-legend','s:9:\"Move page\";'),('en','messages:movepagetext','s:904:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nYou can update redirects that point to the original title automatically.\nIf you choose not to, be sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless the latter is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetext-noredirectfixer','s:801:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nBe sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless it is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetalktext','s:258:\"The associated talk page will be automatically moved along with it <strong>unless:</strong>\n*A non-empty talk page already exists under the new name, or\n*You uncheck the box below.\n\nIn those cases, you will have to move or merge the page manually if desired.\";'),('en','messages:movearticle','s:10:\"Move page:\";'),('en','messages:moveuserpage-warning','s:148:\"<strong>Warning:</strong> You are about to move a user page. Please note that only the page will be moved and the user will <em>not</em> be renamed.\";'),('en','messages:movecategorypage-warning','s:196:\"<strong>Warning:</strong> You are about to move a category page. Please note that only the page will be moved and any pages in the old category will <em>not</em> be recategorized into the new one.\";'),('en','messages:movenologintext','s:81:\"You must be a registered user and [[Special:UserLogin|logged in]] to move a page.\";'),('en','messages:movenotallowed','s:41:\"You do not have permission to move pages.\";'),('en','messages:movenotallowedfile','s:41:\"You do not have permission to move files.\";'),('en','messages:cant-move-user-page','s:68:\"You do not have permission to move user pages (apart from subpages).\";'),('en','messages:cant-move-to-user-page','s:84:\"You do not have permission to move a page to a user page (except to a user subpage).\";'),('en','messages:cant-move-category-page','s:50:\"You do not have permission to move category pages.\";'),('en','messages:cant-move-to-category-page','s:61:\"You do not have permission to move a page to a category page.\";'),('en','messages:newtitle','s:13:\"To new title:\";'),('en','messages:move-