oing any harm, but it is needed only once on installation or upgrade.\";'),('en','messages:smw_smwadmin_permissionswarn','s:412:\"If the operation fails with SQL errors, the database user employed by your wiki (check your LocalSettings.php) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in LocalSettings.php, or use the maintenance script <code>SMW_setup.php</code> which can use the credentials of an administrator.\";'),('en','messages:smw_smwadmin_dbbutton','s:28:\"Initialize or upgrade tables\";'),('en','messages:smw_smwadmin_announce','s:18:\"Announce your wiki\";'),('en','messages:smw_smwadmin_announcedocu','s:458:\"Semantic MediaWiki has a web service for announcing new semantic wiki sites.\nThis is used to maintain a list of public sites that use Semantic MediaWiki, mainly to help the <a href=\"https://semantic-mediawiki.org/wiki/SMW_Project\">Semantic MediaWiki project</a> to get an overview of typical uses of Semantic MediaWiki.\nSee the Semantic MediaWiki homepage for <a href=\"https://semantic-mediawiki.org/wiki/Registry\">further information about this service</a>.\";'),('en','messages:smw_smwadmin_announcebutton','s:193:\"Press the following button to submit your wiki URL to that service.\nThe service will not register wikis that are not publicly accessible, and it will only store publicly accessible information.\";'),('en','messages:smw_smwadmin_datarefresh','s:23:\"Data repair and upgrade\";'),('en','messages:smw_smwadmin_datarefreshdocu','s:450:\"It is possible to restore all Semantic MediaWiki data based on the current contents of the wiki.\nThis can be useful to repair broken data or to refresh the data if the internal format has changed due to some software upgrade.\nThe update is executed page by page and will not be completed immediately.\nThe following shows if an update is in progress and allows you to start or stop updates (unless this feature was disabled by the site administrator).\";'),('en','messages:smw_smwadmin_datarefreshprogress','s:428:\"<strong>An update is already in progress.</strong>\nIt is normal that the update progresses only slowly since it only refreshes data in small chunks each time a user accesses the wiki.\nTo finish this update more quickly, you can invoke the MediaWiki maintenance script <code>runJobs.php</code> (use the option <code>--maxjobs 1000</code> to restrict the number of updates done in one batch).\nEstimated progress of current update:\";'),('en','messages:smw_smwadmin_datarefreshbutton','s:19:\"Start updating data\";'),('en','messages:smw_smwadmin_datarefreshstop','s:16:\"Stop this update\";'),('en','messages:smw_smwadmin_datarefreshstopconfirm','s:15:\"Yes, I am sure.\";'),('en','messages:smw_smwadmin_support','s:15:\"Getting support\";'),('en','messages:smw_smwadmin_supportdocu','s:53:\"Various resources might help you in case of problems:\";'),('en','messages:smw_smwadmin_installfile','s:218:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md#smw-installation\">INSTALL file</a>.\";'),('en','messages:smw_smwadmin_smwhomepage','s:135:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw_smwadmin_mediazilla','s:107:\"Bugs can be reported to <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a>.\";'),('en','messages:smw_smwadmin_questions','s:186:\"If you have further questions or suggestions, join the discussion on <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">Semantic MediaWiki user forum</a>.\";'),('en','messages:smw_adminlinks_datastructure','s:14:\"Data structure\";'),('en','messages:smw_adminlinks_displayingdata','s:12:\"Data displa